import React from "react";
function About() {
  return (
    <>
      <div data-aos="zoom-in zoom-out">
        <div className="about-title">
          <p>Half developer,</p>
          <p>half designer,</p>
          <p>full creative</p>
        </div>
      </div>
    </>
  );
}

export default About;
